import React from "react";
function card(){
   return(<div className="cards">
        <div className="card">
            <img className="img" alt="swaminarayan photo" src=""></img>
            <div className="cardinfo">
                <span className="cardcategory">swaminarayan photo kalupur</span>
                <h3 className="cardtitle">kalupur</h3>
                <a href="https://pbs.twimg.com/media/Dt9bt3IX4AIEY4x.jpg">
                    <button>watch now</button>
                </a>
            </div>
        </div>
    </div>);
}

export default card;
